FormatterManager.formatDateFromUTC = function (utc) {
    if (typeof (utc) != "undefined" && utc != null && utc != "") {
        var date = new Date(utc);
        return date.getDate() + "/" + (date.getMonth() + 1) + "/" + date.getFullYear();
    }
    else {
        return "";
    }
}

